import React from 'react';
import PhotoSide from '../components/PhotoSide';
import Login from '../components/Login';

function LoginPage() {
  return (
    <div className="container-fluid">
      <div className="row g-0">
        <PhotoSide />
        <Login />
      </div>
    </div>
  );
}

export default LoginPage;
